import React, { Component } from "react";
import { Button } from "react-bootstrap";

export default class SearchButton extends React.Component {
  render() {
    return (
      <div>
        <ButtonToolbar>
          <Button as="input" type="submit" value="Submit" />
        </ButtonToolbar>
      </div>
    );
  }
}
